  `bachelorschool` varchar(255) DEFAULT NULL COMMENT '本科学校',
  `masterschool` varchar(255) DEFAULT NULL COMMENT '硕士学校',
  `doctorschool` varchar(255) DEFAULT NULL COMMENT '博士学校',
  `bachelormajor` varchar(255) DEFAULT NULL COMMENT '本科专业',
  `mastermajor` varchar(255) DEFAULT NULL COMMENT '硕士专业',
  `doctormajor` varchar(255) DEFAULT NULL COMMENT '博士专业',
  `graduationdate` datetime DEFAULT NULL COMMENT '毕业时间',
  `hometown` varchar(255) DEFAULT NULL COMMENT '生源地',
  `languagelevel` varchar(255) DEFAULT NULL COMMENT '外语等级',
  `computerlevel` varchar(255) DEFAULT NULL COMMENT '计算机等级',
  `resumenum` varchar(500) DEFAULT NULL COMMENT '简历识别码',
  `resumeurl` varchar(500) DEFAULT NULL COMMENT '简历地址',
  `interviewresult` double DEFAULT NULL COMMENT '面试成绩',
  `englishscore` varchar(64) DEFAULT NULL COMMENT '英语分数',
  `status` varchar(64) DEFAULT NULL COMMENT '状态',
  `interviewdate` varchar(64) DEFAULT NULL COMMENT '面试场次',
  `jobone` varchar(64) DEFAULT NULL COMMENT '岗位一',
  `jobtwo` varchar(64) DEFAULT NULL COMMENT '岗位二',
  `jobthree` varchar(64) DEFAULT NULL COMMENT '岗位三',
  `exemptionreason` varchar(500) DEFAULT NULL COMMENT '免试原因',
  `create_by` varchar(255) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(255) NOT NULL COMMENT '修改者',
